import React from "react";
import "./inde"

const products = [
  { name: "Vegetables, John Farm", price: "$22.50", rating: 4.5, location: "East Coast" },
  { name: "Vegetables, Farmer Farm", price: "$22.50", rating: 4.5, location: "South North 43" },
  { name: "Organic vegetables", price: "$22.50", rating: 4.5, location: "Marina Centre 755" },
  { name: "Vegetable Cabbage", price: "$22.50", rating: 4.5, location: "Somerset 213" },
  { name: "Veg YNZ, John Kitchen", price: "$22.50", rating: 4.5, location: "Datapoint 2314" },
];

function ProductFile() {
  return (
    <div className="app">
      <h1>Product List</h1>
      <div className="product-list">
        {products.map((product, index) => (
          <div className="product-card" key={index}>
            <div className="product-image">üì∑</div>
            <div className="product-details">
              <h3>{product.name}</h3>
              <p>Price: {product.price}</p>
              <p>Rating: ‚≠ê{product.rating}</p>
              <p>Location: {product.location}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductFile;
